CREATE TABLE `ALERT_DETAIL` (
  `COD_ALERT_DETAIL` INTEGER(16) NOT NULL AUTO_INCREMENT COMMENT 'CLAVE PRIMARIA DEL DETALLE DE ALERTAS POR CLIENTE',
  `COD_ALERT_MASTER` INTEGER(16) NOT NULL COMMENT 'CLAVE FORANEA POR MASTER ALERT',
  `FLAG_ACTIVE` INTEGER(1) NOT NULL COMMENT '1 ES ACTIVO, DEPENDIENDO DE UN CIERRE CADA MEDIA HORA ESTE FLAG ESTARÁ ACTIVO O NO',
  `COD_ENTITY` INTEGER(11) NOT NULL COMMENT 'ENTIDAD ASOCIADA',
  `COD_EVENT_GENERATE` INTEGER(11) NOT NULL COMMENT 'EVENTO GENERADO, DEBE TENER INFORMACION SI FLAG_SAVE_HIST = 1 O FLAG_SHOW_CONSOLE = 1',
  `EMAIL_FLAG_ACTIVE` INTEGER(1) DEFAULT '0' COMMENT 'SI ESTA EN 1, ENVÍA CORREO',
  `EMAIL_FLAG_GET_USER_FROM_PROTOCOL` INTEGER(1) DEFAULT '0' COMMENT 'SI ES 1 DEBEMOS INGRESAR COD_PROTOCOLO PARA BUSCAR LOS DESTINATARIOS DE ALLI',
  `EMAIL_COD_PROTOCOL` INTEGER(11) DEFAULT NULL COMMENT 'SI EL FLAG_USE_PROTOCOLO=1 SE TOMAN LOS CONTACTOS DE ESTE PROTOOLO PARA EL ENVÍO DE CORREOS',
  `EMAIL_TIME_MIN_WAIT` INTEGER(11) DEFAULT '10' COMMENT 'TIEMPO MÍNIMO DE ESPERA ENTRE CORREO Y CORREO ENVIADO, POR DEFECTO HAY 10 MINUTOS',
  `EMAIL_LAST_SEND` DATETIME DEFAULT NULL COMMENT 'FECHA HORA DEL ÚLTIMO ENVÍO DE CORREO',
  `EMAIL_FROMTO` TEXT COLLATE latin1_swedish_ci COMMENT 'DESTINATARIOS DEL CORREO',
  `EMAIL_SUBJECT` TEXT COLLATE latin1_swedish_ci COMMENT 'ASUNTO DEL CORREO',
  `EMAIL_TEXT` TEXT COLLATE latin1_swedish_ci COMMENT 'CONTENIDO DEL CORREO',
  `FLAG_SAVE_HIST` INTEGER(1) DEFAULT '1' COMMENT 'SI ESTA EN 1, ALMACENA RESULTADO EN EL HISTÓRICO X FLOTA',
  `FLAG_SHOW_CONSOLE` INTEGER(1) DEFAULT '1' COMMENT 'SI ESTA EN 1, ALMACENA RESULTADO EN EL HISTÓRICO X USUARIO',
  `ALARM_EXPRESION` TEXT COLLATE latin1_swedish_ci COMMENT 'EXPRESION DE LA ALARMA, SI ES TRUE, SE APLICA; ESTA EXPRESION DEBE FUNCIONAR PARA SER EVALUADA POR UN WHERE DE UN SELECT DE MYSQL',
  `FLAG_SEND_SMS` INTEGER(1) DEFAULT NULL,
  `SMS_EXPRESION` VARCHAR(300) COLLATE latin1_swedish_ci DEFAULT NULL,
  `FLAG_MSG_IN` INTEGER(1) DEFAULT NULL,
  `EXPRESION_MSG_IN` VARCHAR(300) COLLATE latin1_swedish_ci DEFAULT NULL,
  `FLAG_MSG_OUT` INTEGER(1) DEFAULT NULL,
  `EXPRESION_MSG_OUT` VARCHAR(300) COLLATE latin1_swedish_ci DEFAULT NULL
)ENGINE=MyISAM COMMENT='' CHECKSUM=0 DELAY_KEY_WRITE=0 PACK_KEYS=0 MIN_ROWS=0 MAX_ROWS=0 ROW_FORMAT=DYNAMIC CHARACTER SET 'latin1'
COLLATE 'latin1_swedish_ci';

COMMIT;



